import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // --- 1. Rapidly add items to the cart ---
    // Wait for product cards to be rendered by the script
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    const initialCartText = await page.locator('div.cart').textContent();

    // Get the first 4 "Add to Cart" buttons
    const addToCartButtons = await page.locator('.add-to-cart').all();
    if (addToCartButtons.length < 4) {
      throw new Error('Could not find enough "Add to Cart" buttons to perform the test.');
    }

    // Click the buttons in quick succession
    await Promise.all([
      addToCartButtons[0].click(),
      addToCartButtons[1].click(),
      addToCartButtons[2].click(),
      addToCartButtons[3].click(),
    ]);

    // Wait for the cart count to update
    await page.waitForFunction(() => document.querySelector('div.cart').textContent.trim().startsWith('4'));
    const cartTextAfterAdd = await page.locator('div.cart').textContent();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_adding_items.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_adding_items.png'));

    // --- 2. Open the cart and verify items ---
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal_open.png'));

    const itemsInCart = await page.locator('.cart-item').count();

    // --- 3. Rapidly remove items from the cart ---
    const removeButtons = await page.locator('.remove-item').all();
    if (removeButtons.length < 2) {
      throw new Error('Could not find enough "Remove" buttons in the cart.');
    }

    // Click remove buttons in quick succession
    await Promise.all([
      removeButtons[0].click(),
      removeButtons[1].click(),
    ]);

    // Wait for the cart count to update
    await page.waitForFunction(() => document.querySelector('div.cart').textContent.trim().startsWith('2'));
    const cartTextAfterRemove = await page.locator('div.cart').textContent();
    const finalItemsInCart = await page.locator('.cart-item').count();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_after_removing_items.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_after_removing_items.png'));

    return {
      success: true,
      action: "Rapidly added 4 items to the cart, then rapidly removed 2 items.",
      extractedData: {
        initialCartText: initialCartText.trim(),
        cartTextAfterAdd: cartTextAfterAdd.trim(),
        itemsInCartBeforeRemove: itemsInCart,
        cartTextAfterRemove: cartTextAfterRemove.trim(),
        finalItemsInCart: finalItemsInCart
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to perform rapid cart manipulation stress test",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
